<?php
include_once 'connection.php';
session_start();

if (!isset($_SESSION["admin_email"]) && !isset($_SESSION["superadmin_email"])) {
    header("Location: index.php");
    exit();
}

function getSumbongLink() {
    if (isset($_SESSION['admin_email']) || isset($_SESSION['superadmin_email'])) {
        return 'report_admin.php';
    } else {
        return 'report.php';
    }
}

function getDashboardLink()
{
    if (
        isset($_SESSION["admin_email"]) ||
        isset($_SESSION["superadmin_email"])
    ) {
      return 'dashboard_admin.php';
    } else {
        return "dashboard.php";
    }
}

function getAdminAccountsPage() {
    if (isset($_SESSION['superadmin_email'])) {
        return 'admin-accounts-table_super.php';
    } else {
        return 'admin-accounts-table.php';
    }
}

if ($_SERVER["REQUEST_METHOD"] == "POST") {
    if (!empty($_POST['report']) && !empty($_POST['company']) && !empty($_POST['brgy']) && isset($_FILES['image'])) {
        // Check if the user has admin or superadmin privileges
        if (isset($_SESSION['admin_email']) || isset($_SESSION['superadmin_email'])) {
            // Check if username is set in session
            if(isset($_SESSION['username'])){
                $username = $_SESSION['username']; 
                $date = date('Y-m-d');
                $address = $_POST['brgy'];
                $name_report = $_POST['report'];
                $agency = $_POST['company'];

                // File upload handling
                $targetDir = "uploads/";
                $fileName = basename($_FILES["image"]["name"]);
                $targetFilePath = $targetDir . $fileName;

                if (move_uploaded_file($_FILES["image"]["tmp_name"], $targetFilePath)) {
                    // Remove "uploads/" prefix from the filename
                    $fileInDatabase = $fileName;

                    $sql = "INSERT INTO report (username, date, address, name_report, image_report, agency) VALUES (?, ?, ?, ?, ?, ?)";
                    $stmt = $conn->prepare($sql);
                    $stmt->bind_param("ssssss", $username, $date, $address, $name_report, $fileInDatabase, $agency);
                    if ($stmt->execute()) {
                        // Redirect to a success page or perform any other actions
                        header("Location: " . getDashboardLink());
                        exit();
                    } else {
                        echo "Error: " . $conn->error;
                    }
                    $stmt->close();
                } else {
                    echo "Sorry, there was an error uploading your file.";
                }
            } else {
                echo "Error: Username not set in session.";
            }
        } else {
            echo "You don't have permission to perform this action.";
        }
    } 
}
