const updateState = (delta) => {
  $.drag.force *= 0.8;
  
  if($.timing.speed) {
    $.scroll.long += Math.round = ($.timing.speed / 5) * delta;
    
    if($.scroll.long > 360) {
      $.scroll.long = $.scroll.long % 360;
    } else if ($.scroll.long < 0) {
      $.scroll.long += 360;   
    }
  }
}

const animateLoop = (time) => {
  $.timing.delta = Math.abs($.timing.last - time);
  $.timing.last = time;
  
  updateState($.timing.delta);
  
  // clear
  $.ctx.fillStyle = '#ffffff';
  $.ctx.fillRect(0, 0, 1800, 1600);
  
  
  let continentNames = ['southamerica', 'northamerica', 'greenland', 'japan', 'africa', 'australia', 'asia', 'indonesia', 'europe', 'britain', 'madagaskar', 'papua', 'nz']; 
  let landPaths = [],
      se = [];
  
  continentNames.forEach((name) => {
    let paths = getLandMassPaths(name, 600, 30);

    if(paths) {
      $.ctx.fillStyle = $.colors.landShade;

      paths.sections.forEach((section) => {
        se.push(section);
        drawSection($.ctx, section, true);
      });

      if(paths.isVisible) {
        landPaths.push(paths.top);
      }
    }
  });
  
  drawGlobe($.ctx, $.colors.ocean);
  
  $.ctx.fillStyle = $.colors.landShade;
  se.forEach((section) => {  
    drawSection($.ctx, section, false);
  });
  
  landPaths.forEach((path) => {
      $.ctx.fillStyle = $.colors.land;
      $.ctx.fill(path);
  });
  
  
  requestAnimationFrame(animateLoop);
}

const drawSection = (ctx, section, drawBackside) => {
    let hasStarted = false,
        limit = -25;
    
    section.ground.forEach(p => {
      if(drawBackside && p.z < 0 || !drawBackside && p.z >= limit) {
        if(!hasStarted) {
          ctx.beginPath();
          hasStarted = true;
        }
        
        ctx.lineTo(p.x, p.y);
      }
    });
  
    section.top = drawBackside ? section.top.reverse() : section.top;
  
    section.top.forEach(p => {
      if(drawBackside && p.z < 0 || !drawBackside && p.z >= limit) {
        ctx.lineTo(p.x, p.y);
      }
    });
  
    if(hasStarted) {
      ctx.closePath();
      ctx.fill();
    }
}

const init = (markers) => {
  $.markers = markers;
  $.canvas = document.querySelector('.globe');
  $.ctx = $.canvas.getContext('2d');
 
  
  requestAnimationFrame(animateLoop);
}

init(markers);
        window.addEventListener('load', function() {
            setTimeout(function() {
                var loadingScreen = document.getElementById('loader');
                loadingScreen.classList.add('fade-out'); // Apply fade-out animation
                setTimeout(function() {
                    loadingScreen.classList.add('hidden'); // Hide the loading screen after animation
                }, 200);
            }, 2000);
        });
        document.getElementById("burger-menu").addEventListener("click", function() {
            this.classList.toggle("active"); // Toggle active class on burger menu icon
            document.querySelector(".navbar-buttons").classList.toggle("active"); // Toggle active class on navbar buttons
        });
        document.addEventListener("DOMContentLoaded", function() {
            var dropdownToggle = document.querySelector(".dropdown-toggle");
            var dropdownMenu = document.querySelector(".dropdown-menu");
            dropdownToggle.addEventListener("click", function() {
                dropdownMenu.classList.toggle("show");
            });
            // Close the dropdown menu when clicking outside of it
            window.addEventListener("click", function(event) {
                if (!dropdownToggle.contains(event.target) && !dropdownMenu.contains(event.target)) {
                    dropdownMenu.classList.remove("show");
                }
            });
        });

        function previewImage(input) {
            var preview = document.getElementById('image-preview');
            var file = input.files[0];
            var reader = new FileReader();

            reader.onload = function () {
                preview.src = reader.result;
                document.getElementById('image-preview-container').style.display = 'block';
            };

            if (file) {
                reader.readAsDataURL(file);
            }
        }

        // Update file name label when a file is selected
        document.getElementById('image-upload').addEventListener('change', function () {
            var fileName = this.files[0].name;
            document.getElementById('file-name-label').innerText = fileName;
            previewImage(this);
        });

        // Update file name label when a file is dropped
        dropzone.ondrop = function(e) {
            e.preventDefault();
            this.className = '';
            var file = e.dataTransfer.files[0];
            document.getElementById('image-upload').files = e.dataTransfer.files;
            document.getElementById('file-name-label').innerText = file.name;
            previewImage(document.getElementById('image-upload'));
        };
    </script>
</body>
</html>